import styled from 'styled-components';

const TitleText = styled.text`
  font-size: 10em;
  text-align: center;
  color: white;
  text-transform: uppercase;
  font-family: SpaceMonoRegular;
  font-weight: 600;
  opacity: 60%;
`
const WelcomeText = styled.text`
  font-size: 1.5em;
  text-align: center;
  text-transform: uppercase;
  letter-spacing: .08em;
  color: white;
  font-family: SpaceMonoRegular;
  font-weight: 100;
`

const FlexWrapper = styled.div`
  width: 100%;
  padding-bottom: 0;
  display: flex;
  flex-direction: column;
  align-items: center;
`

export default function Title() {
  return (
    <div>
      <WelcomeText>welcome to the world of</WelcomeText>
      <TitleText>/panacea.</TitleText>
    </div>
  );
}
